import React, { useState, useEffect } from 'react';
import {
  Container,
  AppBar,
  Toolbar,
  Typography,
  Box,
  Card,
  CardContent,
  Button,
  Grid,
  CircularProgress,
  Alert,
  Chip,
  LinearProgress,
  Paper
} from '@mui/material';
import CloudUpload from '@mui/icons-material/CloudUpload';
import VideoLibrary from '@mui/icons-material/VideoLibrary';
import CheckCircle from '@mui/icons-material/CheckCircle';
import Warning from '@mui/icons-material/Warning';
import ErrorIcon from '@mui/icons-material/Error';
import Analytics from '@mui/icons-material/Analytics';
import Image from '@mui/icons-material/Image';
import RecordVoiceOver from '@mui/icons-material/RecordVoiceOver';
import TextFields from '@mui/icons-material/TextFields';

const API_BASE_URL = 'http://localhost:8000';

function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [connectionStatus, setConnectionStatus] = useState('testing');

  // Test connection on startup
  useEffect(() => {
    testConnection();
  }, []);

  const testConnection = async () => {
    try {
      const response = await fetch(`${API_BASE_URL}/health`);
      if (response.ok) {
        setConnectionStatus('connected');
      } else {
        setConnectionStatus('disconnected');
      }
    } catch (err) {
      setConnectionStatus('disconnected');
    }
  };

  const handleFileChange = (event) => {
    const file = event.target.files[0];
    if (file) {
      if (file.type.startsWith('video/')) {
        setSelectedFile(file);
        setError('');
        setAnalysis(null); // Clear previous results
      } else {
        setError('Please select a valid video file');
        setSelectedFile(null);
      }
    }
  };

  const handleAnalyze = async () => {
    if (!selectedFile) {
      setError('Please select a video file');
      return;
    }

    setLoading(true);
    setError('');
    setAnalysis(null);

    try {
      const formData = new FormData();
      formData.append('file', selectedFile);
      console.log('Uploading file:', selectedFile.name);

      const response = await fetch(`${API_BASE_URL}/upload-video`, {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`HTTP ${response.status}: ${response.statusText}`);
      }

      const analysisText = await response.text();
      console.log('Analysis result:', analysisText);
      setAnalysis({ full_report: analysisText });

    } catch (err) {
      console.error('Analysis error:', err);
      setError(`Analysis failed: ${err.message}`);
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'conforme': return 'success';
      case 'attention': return 'warning';
      case 'non_conforme': return 'error';
      default: return 'default';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'conforme': return <CheckCircle />;
      case 'attention': return <Warning />;
      case 'non_conforme': return <ErrorIcon />;
      default: return null;
    }
  };

  const formatFileSize = (bytes) => {
    if (bytes === 0) return '0 Bytes';
    const k = 1024;
    const sizes = ['Bytes', 'KB', 'MB', 'GB'];
    const i = Math.floor(Math.log(bytes) / Math.log(k));
    return parseFloat((bytes / Math.pow(k, i)).toFixed(2)) + ' ' + sizes[i];
  };

  return (
    <div style={{ minHeight: '100vh', backgroundColor: '#f5f5f5' }}>
      <AppBar position="static" sx={{ backgroundColor: '#1976d2' }}>
        <Toolbar>
          <VideoLibrary sx={{ mr: 2 }} />
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            AI Video Content Analyzer
          </Typography>
          <Chip
            icon={connectionStatus === 'connected' ? <CheckCircle /> : <ErrorIcon />}
            label={connectionStatus === 'connected' ? 'Connected' : 'Disconnected'}
            color={connectionStatus === 'connected' ? 'success' : 'error'}
            variant="filled"
            size="small"
          />
        </Toolbar>
      </AppBar>

      <Container maxWidth="lg" sx={{ mt: 4, pb: 4 }}>
        {/* Connection Status */}
        {connectionStatus === 'disconnected' && (
          <Alert severity="error" sx={{ mb: 4 }} action={
            <Button color="inherit" size="small" onClick={testConnection}>
              Retry
            </Button>
          }>
            Cannot connect to backend server. Make sure the server is running on http://localhost:8000
          </Alert>
        )}

        {connectionStatus === 'connected' && (
          <Alert severity="success" sx={{ mb: 4 }}>
             AI Video Analyzer ready! Upload and analyze your video files.
          </Alert>
        )}

        {/* Upload Section */}
        <Card sx={{ mb: 4 }}>
          <CardContent>
            <Typography variant="h5" gutterBottom color="primary">
               Upload Video for Analysis
            </Typography>
            <Typography variant="body2" color="text.secondary" gutterBottom>
              Upload your video file to analyze content for YouTube policy compliance
            </Typography>

            <Box sx={{ mt: 3 }}>
              <input
                accept="video/*"
                style={{ display: 'none' }}
                id="video-upload"
                type="file"
                onChange={handleFileChange}
              />
              <label htmlFor="video-upload">
                <Button
                  variant="outlined"
                  component="span"
                  startIcon={<CloudUpload />}
                  sx={{ mr: 2 }}
                  disabled={connectionStatus !== 'connected'}
                >
                  Choose Video File
                </Button>
              </label>

              {selectedFile && (
                <Chip
                  label={`${selectedFile.name} (${formatFileSize(selectedFile.size)})`}
                  color="primary"
                  variant="outlined"
                  sx={{ ml: 1 }}
                />
              )}

              <Box sx={{ mt: 2 }}>
                <Button
                  variant="contained"
                  startIcon={loading ? <CircularProgress size={20} color="inherit" /> : <Analytics />}
                  onClick={handleAnalyze}
                  disabled={loading || !selectedFile || connectionStatus !== 'connected'}
                  size="large"
                  sx={{
                    background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
                    color: 'white'
                  }}
                >
                  {loading ? 'Analyzing...' : 'Analyze Video'}
                </Button>
              </Box>

              {error && (
                <Alert severity="error" sx={{ mt: 2 }}>
                  {error}
                </Alert>
              )}
            </Box>
          </CardContent>
        </Card>

        {/* Progress Bar */}
        {loading && (
          <Paper sx={{ p: 2, mb: 4 }}>
            <Typography variant="h6" gutterBottom>
              Analyzing video content...
            </Typography>
            <LinearProgress sx={{ mb: 1 }} />
            <Typography variant="body2" color="text.secondary">
              Processing video frames, audio, and text content with AI...
            </Typography>
          </Paper>
        )}

        {/* Analysis Results */}
        {analysis && (
          <>
            {/* Raw Model Output */}
            {analysis.full_report && (
              <Card sx={{ mb: 3, backgroundColor: '#fffbe6', border: '1px solid #ffe082' }}>
                <CardContent>
                  <Typography variant="h6" gutterBottom color="warning.main">
                     Raw Model Output
                  </Typography>
                  <Box sx={{ maxHeight: 400, overflow: 'auto', background: '#fffde7', p: 2, borderRadius: 1, fontFamily: 'monospace', whiteSpace: 'pre-wrap', fontSize: '1rem', color: '#333' }}>
                    {analysis.full_report}
                  </Box>
                </CardContent>
              </Card>
            )}
            {/* Frame Previews Gallery */}
            {analysis.image?.details?.frame_preview_paths && analysis.image.details.frame_preview_paths.length > 0 && (
              <Card sx={{ mb: 3, backgroundColor: '#f5f5f5' }}>
                <CardContent>
                  <Typography variant="h6" gutterBottom>
                     Video Frame Previews
                  </Typography>
                  <Grid container spacing={2}>
                    {analysis.image.details.frame_preview_paths.map((fullPath) => {
                      // Extract frame_id from the path (filename only)
                      const frameId = fullPath.split(/[/\\]/).pop();
                      const imgUrl = `${API_BASE_URL}/frame-preview/${frameId}`;
                      return (
                        <Grid item xs={6} sm={4} md={3} key={frameId}>
                          <Paper elevation={2} sx={{ p: 1, textAlign: 'center' }}>
                            <img
                              src={imgUrl}
                              alt={frameId}
                              style={{ width: '100%', maxHeight: 120, objectFit: 'cover', borderRadius: 8 }}
                            />
                            <Typography variant="caption" sx={{ mt: 1, display: 'block' }}>{frameId}</Typography>
                          </Paper>
                        </Grid>
                      );
                    })}
                  </Grid>
                </CardContent>
              </Card>
            )}
            {/* Video Info */}
            <Card sx={{ mb: 3 }}>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                   Video Information
                </Typography>
                <Grid container spacing={2}>
                  <Grid item xs={6} md={3}>
                    <Typography variant="body2" color="text.secondary">Duration</Typography>
                    <Typography variant="body1">{analysis.video_info?.duration || 'N/A'}s</Typography>
                  </Grid>
                  <Grid item xs={6} md={3}>
                    <Typography variant="body2" color="text.secondary">Resolution</Typography>
                    <Typography variant="body1">{analysis.video_info?.resolution || 'N/A'}</Typography>
                  </Grid>
                  <Grid item xs={6} md={3}>
                    <Typography variant="body2" color="text.secondary">FPS</Typography>
                    <Typography variant="body1">{analysis.video_info?.fps || 'N/A'}</Typography>
                  </Grid>
                  <Grid item xs={6} md={3}>
                    <Typography variant="body2" color="text.secondary">Processing Time</Typography>
                    <Typography variant="body1">{analysis.processing_time?.toFixed(2) || 'N/A'}s</Typography>
                  </Grid>
                </Grid>
              </CardContent>
            </Card>

            <Grid container spacing={3}>
              {/* Text Analysis */}
              <Grid item xs={12} md={4}>
                <Card sx={{ height: '100%' }}>
                  <CardContent>
                    <Box display="flex" alignItems="center" mb={2}>
                      <TextFields color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Text Analysis</Typography>
                    </Box>

                    <Box display="flex" alignItems="center" mb={2}>
                      <Chip
                        icon={getStatusIcon(analysis.title?.status)}
                        label={(analysis.title?.status || 'N/A').toUpperCase()}
                        color={getStatusColor(analysis.title?.status)}
                        variant="filled"
                      />
                      <Typography variant="h4" sx={{ ml: 2 }}>
                        {analysis.title?.score || 'N/A'}%
                      </Typography>
                    </Box>

                    <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                      Results:
                    </Typography>
                    {analysis.title?.issues?.map((issue, index) => (
                      <Typography key={index} variant="body2" sx={{ mt: 0.5 }}>
                         {issue}
                      </Typography>
                    ))}
                  </CardContent>
                </Card>
              </Grid>

              {/* Audio Analysis */}
              <Grid item xs={12} md={4}>
                <Card sx={{ height: '100%' }}>
                  <CardContent>
                    <Box display="flex" alignItems="center" mb={2}>
                      <RecordVoiceOver color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Audio Analysis</Typography>
                    </Box>

                    <Box display="flex" alignItems="center" mb={2}>
                      <Chip
                        icon={getStatusIcon(analysis.voice?.status)}
                        label={(analysis.voice?.status || 'N/A').toUpperCase()}
                        color={getStatusColor(analysis.voice?.status)}
                        variant="filled"
                      />
                      <Typography variant="h4" sx={{ ml: 2 }}>
                        {analysis.voice?.score || 'N/A'}%
                      </Typography>
                    </Box>

                    <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                      Results:
                    </Typography>
                    {analysis.voice?.issues?.map((issue, index) => (
                      <Typography key={index} variant="body2" sx={{ mt: 0.5 }}>
                         {issue}
                      </Typography>
                    ))}
                  </CardContent>
                </Card>
              </Grid>

              {/* Video/Image Analysis */}
              <Grid item xs={12} md={4}>
                <Card sx={{ height: '100%' }}>
                  <CardContent>
                    <Box display="flex" alignItems="center" mb={2}>
                      <Image color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Video Frame Analysis</Typography>
                    </Box>

                    <Box display="flex" alignItems="center" mb={2}>
                      <Chip
                        icon={getStatusIcon(analysis.image?.status)}
                        label={(analysis.image?.status || 'N/A').toUpperCase()}
                        color={getStatusColor(analysis.image?.status)}
                        variant="filled"
                      />
                      <Typography variant="h4" sx={{ ml: 2 }}>
                        {analysis.image?.score || 'N/A'}%
                      </Typography>
                    </Box>

                    <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                      Frames analyzed: {analysis.image?.details?.frames_analyzed || 0}
                    </Typography>
                    <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                      Results:
                    </Typography>
                    {analysis.image?.issues?.map((issue, index) => (
                      <Typography key={index} variant="body2" sx={{ mt: 0.5 }}>
                         {issue}
                      </Typography>
                    ))}
                  </CardContent>
                </Card>
              </Grid>

              {/* Overall Results */}
              <Grid item xs={12}>
                <Card>
                  <CardContent>
                    <Box display="flex" alignItems="center" mb={2}>
                      <Analytics color="primary" sx={{ mr: 1 }} />
                      <Typography variant="h6">Overall YouTube Compliance Report</Typography>
                    </Box>

                    <Box display="flex" alignItems="center" mb={3}>
                      <Typography variant="h3" sx={{ mr: 2 }}>
                        Overall Status:
                      </Typography>
                      <Chip
                        icon={getStatusIcon(analysis.overall)}
                        label={analysis.overall?.toUpperCase() || 'N/A'}
                        color={getStatusColor(analysis.overall)}
                        variant="filled"
                        sx={{ fontSize: '1.2rem', padding: '12px 20px' }}
                      />
                    </Box>

                    <Typography variant="h6" sx={{ mb: 2 }}>Category Scores:</Typography>
                    <Grid container spacing={2}>
                      <Grid item xs={4}>
                        <Box textAlign="center" p={2} border={1} borderColor="grey.300" borderRadius={2}>
                          <Typography variant="h4" color="primary">
                            {analysis.title?.score || 'N/A'}%
                          </Typography>
                          <Typography variant="body2">Text Content (20%)</Typography>
                        </Box>
                      </Grid>
                      <Grid item xs={4}>
                        <Box textAlign="center" p={2} border={1} borderColor="grey.300" borderRadius={2}>
                          <Typography variant="h4" color="primary">
                            {analysis.voice?.score || 'N/A'}%
                          </Typography>
                          <Typography variant="body2">Audio Content (35%)</Typography>
                        </Box>
                      </Grid>
                      <Grid item xs={4}>
                        <Box textAlign="center" p={2} border={1} borderColor="grey.300" borderRadius={2}>
                          <Typography variant="h4" color="primary">
                            {analysis.image?.score || 'N/A'}%
                          </Typography>
                          <Typography variant="body2">Video Frames (45%)</Typography>
                        </Box>
                      </Grid>
                    </Grid>

                    <Box sx={{ mt: 3, p: 2, backgroundColor: '#f5f5f5', borderRadius: 1 }}>
                      <Typography variant="body2" color="text.secondary">
                         Analysis completed in {analysis.processing_time?.toFixed(2)}s
                        {analysis.image?.details?.frames_analyzed && (
                          <>  {analysis.image.details.frames_analyzed} video frames analyzed</>
                        )}
                         AI-powered content detection enabled
                      </Typography>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            </Grid>
          </>
        )}
      </Container>
    </div>
  );
}

export default App;
